import React, { Component } from "react";
import Name from "../components/Name";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nameValue: "Duc Phan",
      list: ["abc", "def"]
    };
  }

  render() {
    let finalList = [];
    this.state.list.forEach(item => {
      finalList.push(item);
    })
    return (
      <div>
        <Name nameValue={this.state.nameValue} />
        {/* <select>
          <option>{finalList}</option>
        </select> */}
        <ul>{finalList}</ul>
      </div>
    );
  }
}

export default Home;
